import React from "react";
import UserData from "./userData";

function User(props) {
  if (props.UserData instanceof Array) {
    return props.UserData.map(function (object, i) {
      return (
        <article>
          <div class="card">
            <img
              src="http://localhost:3000/img_avatar.png"
              alt="Avatar"
              class="img"
            />

            <div class="container">
              <h4>
                <b>{object.name}</b>
              </h4>
              <p>{object.designation}</p>
            </div>
          </div>
        </article>
      );
    });
  }
}

function CustomeHook() {
  // Declare a new state variable, which we'll call "count"
  return (
    <section>
      <User />
    </section>
  );
}
export default CustomeHook;
